User Stories Alice wants to synchronise its local state from Bob from Alice’s Tip: Alice downloads Block Headers from Bob (starting from Alice’s Tip); Bob does not know this Tip: Error: unknown block Alice starts again with a previous Tip; Bob does know this state: Bob streams back the block headers Alice downloads block Since Alice knows the list of Block Headers and the number of blocks to download, Alice can download from multiple peers, requiring to get block stream from different Hash in this list of Block; State: tip_hash, storage Pseudocode (executed by Alice): sync(): bob.get_headers(alice.tip) Alice wants to propagate a transaction to Bob Alice send the transaction hash to Bob Bob replies whether it want to hear more Alice send the transaction to Bob if Bob agrees Alice wants to submit a Block to Bob Alice sends the Header to Bob; Bob replies whether it want to hear more Alice sends the Block to Bob if Bob agrees Alice want to exchange peers with Bob High Level Messages We model everything so that we don’t need any network state machine. Everything is stateless for Handshake: () -> (Version, Hash) This should be the first request performed by the client after connecting. The server responds with the protocol version and the hash of the genesis block. The handshake is used to establish that the remote node has a compatible protocol implementation and serves the right block chain. Tip: () -> Header: Return the header of the latest block known by the peer (also known as at the tip of the blockchain). DD? : Block vs hash: block is large but contain extra useful metadata (slotid, prevhash), whereas hash is small. GetHeaders: ([Hash]) -> [Header]: Fetch the headers (cryptographically verifiable metadata summaries) of the blocks identified by hashes. GetBlocks: ([Hash]) -> [Block]: Like GetHeaders, but returns full blocks. PullBlocksToTip: ([Hash]) -> Stream<Block>: Retrieve a stream of blocks descending from one of the given hashes, up to the remote’s current tip. This is an easy way to pull blockchain state from a single peer, for clients that don’t have a need to fiddle with batched GetBlocks requests and traffic distribution among multiple peers. BlockSubscription: (Stream<Header>) -> Stream<BlockEvent> Establish a bidirectional subscription to send and receive announcements of new blocks and (in the client role) receive solicitations to upload blocks or push the chain of headers. The stream item is a tagged enumeration: BlockEvent: Announce(Header)|Solicit([Hash])|Missing([Hash], Hash) Announce propagates header information of a newly minted block. Solicit requests the client to upload blocks identified by the given hashes using the UploadBlocks request. Missing requests the client to stream the chain of block headers using the given range parameters. The meaning of the parameters is the same as in the PullHeaders request. The client does not need to stream solicitations upwards, as it can request blocks directly with GetBlocks or PullHeaders. The announcements send in either direction are used for both announcing new blocks when minted by this node in the leadership role, and propagating blocks received from other nodes on the p2p network. PullHeaders: ([Hash], Hash) -> Stream<Header> Retrieve a stream of headers for blocks descending from one of the hashes given in the first parameter, up to the hash given in the second parameter. The starting point that is latest in the chain is selected. The client sends this request after receiving an announcement of a new block via the BlockSubscription stream, when the parent of the new block is not present in its local storage. The proposed starting points are selected from locally known blocks with exponentially receding depth. PushHeaders: (Stream<Header>) Streams the chain of headers in response to a Missing event received via the BlockSubscription stream. UploadBlocks: (Stream<Block>) Uploads blocks in response to a Solicit event received via the BlockSubscription stream. ContentSubscription: (Stream<Fragment>) -> Stream<Fragment> Establish a bidirectional subscription to send and receive new content for the block under construction. Used for submission of new fragments submitted to the node by application clients, and for relaying of fragment gossip on the network. P2P Messages: see P2P messages section. The protobuf files describing these methods are available in the proto directory of chain-network crate in the chain-libs project repository. Pseudocode chain sync algorithm struct State { ChainState chain_state, HashMap<Hash, Block> blocks
} struct ChainState { Hash tip, HashSet<Hash> ancestors, Utxos ..., ...
} impl ChainState { Fn is_ancestor(hash) -> bool { self.ancestors.exists(hash) }
} // Fetch ‘dest_tip’ from `server’ and make it our tip, if it’s better.
sync(state, server, dest_tip, dest_tip_length) { if is_ancestor(dest_tip, state.chain_state.tip) { return; // nothing to do } // find a common ancestor of `dest_tip` and our tip. // FIXME: do binary search to find exact most recent ancestor n = 0; loop { hashes = server.get_chain_hashes(dest_tip, 2^n, 1); if hashes == [] { ancestor = genesis; break; } ancestor = hashes[0]; if state.chain_state.has_ancestor(ancestor): { break } n++; } // fetch blocks from ancestor to dest_tip, in batches of 1000 // blocks, forwards // FIXME: integer arithmetic is probably off a bit here, but you get the idea. nr_blocks_to_fetch = 2^n; batch_size = 1000; batches = nr_blocks_to_fetch / batch_size; new_chain_state = reconstruct_chain_state_at(ancestor); for (i = batches; i > 0; i--) { // validate the headers ahead of downloading blocks to validate // cryptographically invalid blocks. It is interesting to do that // ahead of time because of the small size of a BlockHeader new_hashes = server.get_chain_hashes(dest_tip, (i - 1) * batch_size, batch_size); new_headers = server.get_headers(new_hashes); if new_headers are invalid { stop; } new_blocks = server.get_blocks(new_hashes).reverse(); for block in new_blocks { new_chain_state.validate_block(block)?; write_block_to_storage(block); } } if new_chain_state.chain_quality() > state.chain_state.chain_quality() { state.chain_state = new_chain_state }
} Choice of wire Technology We don’t rely on any specific wire protocol, and only require that the wire protocol allow the transfer of the high level messages in a bidirectional way. We chose to use GRPC/Protobuf as initial technology choice: Efficiency : Using Protobuf, HTTP2 , binary protocol Bidirectional : through HTTP2, allowing stream of data. data push on a single established connection. Potential Authentication : Security / Stream atomicity towards malicious MITM Simplicity : Many languages supported ( code generation , wide support ) Language/Architecture Independent : works on everything Protobuf file acts as documentation and are relatively easy to version Connections and bidirectional subscription channels can be left open (especially for clients behind NAT), although we can cycle connections with a simple RCU-like system.

